/** @jsxImportSource theme-ui */
import { ThemeProvider, Button } from "theme-ui";
import { theme } from "../theme";

export default {
  title: "Button",
  component: Button,
};

function Settings() {
  return (
    <ThemeProvider theme={theme}>
      <Button variant='headerBtn'>
          Click me
        </Button>
    </ThemeProvider>
  );
}

export { Settings };
